import React from 'react';

import {Login,Home,Imc} from './src/index';

import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
 
const Stack = createStackNavigator();
const Tab = createBottomTabNavigator();

function Tabs() {
    return(
        <Tab.Navigator>
            <Tab.Screen name="Home" component={Home} options={{headerTitleStyle:{alignSelf:'center'}}}/>
            <Tab.Screen name="Imc" component={Imc} options={{headerTitleStyle:{alignSelf:'center'}}}/>
        </Tab.Navigator>
    );
}

const App = () => (
    <NavigationContainer>
        <Stack.Navigator initialRouteName="Login">
            <Stack.Screen name="Login" component={Login} options={{headerTitleStyle:{alignSelf:'center'}}} />
            <Stack.Screen name="Home" component={Tabs} />
        </Stack.Navigator>

    </NavigationContainer>
);

export default App;
